#include <iostream>
#include <conio.h>

using namespace std;
using namespace System;

const int WIDTH = 80;
const int HEIGTH = 20;

const int LIMITVUELTAS = 5;

int main() {


	srand(time(0));


	Console::SetWindowSize(WIDTH, HEIGTH);
	Console::CursorVisible = false;

	int x = 10, y = 10;
	int upperbound = 9, lowerbound = 12, leftbound = 9, rightbound = 20;

	char dir = 'd';


	int num_vueltas = 0;

	int xMina1 = rand()%WIDTH, yMina1 = rand() % HEIGTH;

	int xMina2 = rand() % WIDTH, yMina2 = rand() % HEIGTH;
	cout << xMina1 << " " << yMina1;
	
	bool active = false;

	while (true) {

		if (_kbhit()) {
			int key = _getch();
			if (key == 'y') active = true;
		}

		Console::SetCursorPosition(x, y);
		cout << " ";

		if (active && num_vueltas <= LIMITVUELTAS) {
			if (dir == 'd' && y + 1 >= lowerbound) {
				dir = 'r';
				leftbound--;
			}
			if (dir == 'r' && x + 1 >= rightbound) {
				dir = 'u';
				lowerbound++;
			}
			if (dir == 'u' && y - 1 <= upperbound) {
				dir = 'l';
				rightbound++;
			}
			if (dir == 'l' && x - 1 <= leftbound) {
				dir = 'd';
				upperbound--;
				num_vueltas++;
			}

			int ny = y, nx = x;
			if (dir == 'u') ny--;
			if (dir == 'l') nx--;
			if (dir == 'r') nx++;
			if (dir == 'd') ny++;

			if (xMina1 == x && yMina1 == y) {
				Console::SetCursorPosition(0, 0);
				cout << "Mina encontrada";
			}

			if (ny > upperbound && ny < lowerbound && nx > leftbound && nx < rightbound) {
				x = nx;
				y = ny;
			}
		}

		Console::SetCursorPosition(x, y);
		cout << "*";

		_sleep(25);

	}


	getch();
	return 0;
}

